import React from 'react';
import styled from 'styled-components';

const BlogCreateComponent: React.FC = () =>{
    return(
        <BlogCreateWrap>
            this is BlogCreateComponent
        </BlogCreateWrap>
    );
}

const BlogCreateWrap = styled.div`
    height:100vh;
`;

export default BlogCreateComponent;
